import React from 'react';
import styled from 'styled-components';

const Div=styled.div`
  width:60%;
  border:solid 1px #dbdbdb;
`
const ProfileDiv=styled.div`
  display:flex;
  justify-content:flex-start;
`
const ProfileImg=styled.img`
  border-radius:50%;
  width:38px;
  height:38px;
  object-fit:cover;
  margin-right:25px;
`
const ProfileText=styled.div`
  font-size:20px;
  margin-bottom:2px;
  font-weight:bold;
`
const ChangeProfile=styled.div`
  font-size:14px;
  color:#0095f6;
  font-weight:bold;
`
const NameDiv=styled.div`
  display:flex;
  justify-contet:flex-start;
  align-items:center;
`
const Name=styled.div`
  font-size:20px;
  font-weight:bold;
  margin-right:25px;
`
const NameInput=styled.input`
  width: 50%;
  height:32px;
  padding:0 10px;
  border-radius:3px;
  border:solid 1px #dbdbdb;
`
const NameText=styled.div`
  width: 55%;
  color:#8e8e8e;
  font-size:12px;
  line-height:16px;
`
const NickNameDiv=styled.div`

`
const WebSiteDiv=styled.div`

`
const PrivateDiv=styled.div`

`
const RecommandDiv=styled.div`

`

function Edit() {
  return (
    <Div>
      <ProfileDiv>
        <ProfileImg src='../images/activeStatus/photo.png'></ProfileImg>
        <div>
        <ProfileText>username</ProfileText>
        <ChangeProfile>프로필 사진 바꾸기</ChangeProfile>
        </div>
      </ProfileDiv>
      <NameDiv>
        <Name>이름</Name>
        <div>
        <NameInput value='USER'></NameInput>
        <NameText>사람들이 이름, 별명 또는 비즈니스 이름 등 회원님의 알려진 이름을 사용하여 회원님의 계정을 찾을 수 있도록 도와주세요. <br/><br/> 이름은 14일 안에 두 번만 변경할 수 있습니다.</NameText>
        </div>     
      </NameDiv>
      <NickNameDiv></NickNameDiv>
      <WebSiteDiv></WebSiteDiv>
      <PrivateDiv></PrivateDiv>
      <RecommandDiv></RecommandDiv>
    </Div>
  );
}

export default Edit;
